                  <div>
                    <Label htmlFor="is_verified" className="cursor-pointer">Verified Badge</Label>
                    <p className="text-xs text-slate-500">Grant verified status to user</p>
                  </div>
                </div>
                <Switch
                  id="is_verified"
                  checked={formData.is_verified}
                  onCheckedChange={(checked) => setFormData({ ...formData, is_verified: checked })}
                />
              </div>

              <div className="flex items-center justify-between p-3 border border-slate-200 rounded-lg bg-slate-50">
                <div className="flex items-center gap-3">
                  <UserCheck className="w-5 h-5 text-blue-600" />
                  <div>
                    <Label htmlFor="is_active" className="cursor-pointer">Active Status</Label>
                    <p className="text-xs text-slate-500">User can login to platform</p>
                  </div>
                </div>
                <Switch
                  id="is_active"
                  checked={formData.is_active}
                  onCheckedChange={(checked) => setFormData({ ...formData, is_active: checked })}
                />
              </div>

              <div className="flex items-center justify-between p-3 border border-slate-200 rounded-lg bg-slate-50">
                <div className="flex items-center gap-3">
                  <Crown className="w-5 h-5 text-amber-600" />
                  <div>
                    <Label htmlFor="is_premium" className="cursor-pointer">Premium Status</Label>
                    <p className="text-xs text-slate-500">Grant premium features access</p>
                  </div>
                </div>
                <Switch
                  id="is_premium"
                  checked={formData.is_premium}
                  onCheckedChange={(checked) => setFormData({ ...formData, is_premium: checked })}
                />
              </div>
            </div>
          </div>

          <DialogFooter>
            <Button variant="outline" onClick={() => setShowCreateDialog(false)} className="flex items-center gap-2">
              <XCircle className="w-4 h-4" />
              Cancel
            </Button>
            <Button onClick={handleCreateUser} className="bg-blue-600 hover:bg-blue-700 flex items-center gap-2">
              <CheckCircle className="w-4 h-4" />
              Create User
            </Button>
          </DialogFooter>
        </DialogContent>
      </Dialog>

      {/* User Detail Dialog - Modernized */}
      <Dialog open={showDetailDialog} onOpenChange={setShowDetailDialog}>
        <DialogContent className="max-w-4xl max-h-[90vh] overflow-y-auto bg-gradient-to-br from-slate-50 to-white">
          <DialogHeader className="border-b border-slate-200 pb-4 bg-gradient-to-r from-blue-50 to-purple-50 -mx-6 -mt-6 px-6 pt-6 rounded-t-lg">
            <DialogTitle className="flex items-center gap-3 text-2xl font-bold">
              <div className="w-12 h-12 bg-gradient-to-br from-blue-500 to-purple-600 rounded-xl flex items-center justify-center shadow-lg">
                <User className="w-6 h-6 text-white" />
              </div>
              <span className="bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent">
                User Details
              </span>
            </DialogTitle>
          </DialogHeader>

          {selectedUser && (
            <div className="space-y-6 py-4">
              {/* User Profile Section - Enhanced */}
              <Card className="border-2 border-slate-100 shadow-lg hover:shadow-xl transition-shadow duration-300">
                <CardHeader className="bg-gradient-to-r from-blue-50 via-purple-50 to-pink-50 pb-5 border-b-2 border-slate-100">
                  <CardTitle className="flex items-center gap-2 text-lg font-bold text-slate-800">
                    <User className="w-6 h-6 text-blue-600" />
                    Profile Information
                  </CardTitle>
                </CardHeader>
                <CardContent className="pt-6 bg-white">
                  <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                    <div className="space-y-5">
                      <div className="flex items-center gap-4 p-4 bg-gradient-to-r from-blue-50 via-purple-50 to-pink-50 rounded-xl shadow-sm border border-slate-100 hover:shadow-md transition-all">
                        <div className="w-20 h-20 bg-gradient-to-br from-blue-500 via-purple-600 to-pink-600 rounded-2xl flex items-center justify-center text-white font-bold text-2xl shadow-lg">
                          {selectedUser.user?.username?.charAt(0).toUpperCase()}
                        </div>
                        <div className="flex-1">
                          <h3 className="font-bold text-lg flex items-center gap-2 text-slate-900">
                            {selectedUser.user?.username}
                            {selectedUser.user?.is_verified && (
                              <ShieldCheck 
                                className="w-5 h-5 text-blue-500"
                                style={{
                                  fill: '#3B82F6',
                                  stroke: '#FFFFFF',
                                  strokeWidth: '1px'
                                }}
                                title="Verified User"
                              />
                            )}
                            {selectedUser.user?.is_premium && (
                              <Badge className="bg-gradient-to-r from-amber-400 to-amber-600 text-white border-0 text-xs shadow-md">
                                <Crown className="w-3 h-3 mr-1" />
                                Premium
                              </Badge>
                            )}
                          </h3>
                          <p className="text-slate-600 text-sm mt-1">{selectedUser.user?.full_name || 'No full name provided'}</p>
                        </div>
                      </div>

                      <div className="space-y-4">
                        <div className="p-4 bg-white rounded-xl border-2 border-slate-100 shadow-sm hover:border-blue-300 hover:shadow-md transition-all">
                          <Label className="text-slate-500 flex items-center gap-2 text-xs font-semibold mb-2 uppercase tracking-wide">
                            <Mail className="w-4 h-4 text-blue-500" />
                            Email Address
                          </Label>
                          <p className="text-slate-900 font-semibold text-base">{selectedUser.user?.email}</p>
                        </div>
                        <div className="p-4 bg-white rounded-xl border-2 border-slate-100 shadow-sm hover:border-green-300 hover:shadow-md transition-all">
                          <Label className="text-slate-500 flex items-center gap-2 text-xs font-semibold mb-2 uppercase tracking-wide">
                            <Phone className="w-4 h-4 text-green-500" />
                            Phone Number
                          </Label>
                          <p className="text-slate-900 font-semibold text-base">{selectedUser.user?.phone || 'Not provided'}</p>
                        </div>
                      </div>
                    </div>

                    <div className="space-y-4">
                      <div className="grid grid-cols-2 gap-4">
                        <div className="p-4 bg-gradient-to-br from-green-50 to-emerald-50 rounded-xl border-2 border-green-200 shadow-md hover:shadow-lg transition-all">
                          <Label className="text-green-700 text-xs font-bold mb-2 block uppercase tracking-wide">KYC Status</Label>
                          {getKycBadge(selectedUser.user?.kyc_status)}
                        </div>
                        <div className="p-4 bg-gradient-to-br from-blue-50 to-cyan-50 rounded-xl border-2 border-blue-200 shadow-md hover:shadow-lg transition-all">
                          <Label className="text-blue-700 text-xs font-bold mb-2 block uppercase tracking-wide">Account Status</Label>
                          {getStatusBadge(selectedUser.user?.is_active)}
                        </div>
                      </div>

                      <div className="p-5 bg-gradient-to-br from-purple-50 via-pink-50 to-rose-50 rounded-xl border-2 border-purple-200 shadow-md hover:shadow-lg transition-all">
                        <Label className="text-purple-700 flex items-center gap-2 text-xs font-bold mb-3 uppercase tracking-wide">
                          <Calendar className="w-4 h-4" />
                          Member Since
                        </Label>
                        <p className="text-2xl font-extrabold text-transparent bg-gradient-to-r from-purple-600 to-pink-600 bg-clip-text">
                          {new Date(selectedUser.user?.created_at).toLocaleDateString('en-US', { 
                            year: 'numeric', 
                            month: 'short', 
                            day: 'numeric' 
                          })}
                        </p>
                        <p className="text-xs text-purple-600 mt-2 font-medium">
                          {Math.floor((new Date() - new Date(selectedUser.user?.created_at)) / (1000 * 60 * 60 * 24))} days ago
                        </p>
                      </div>
                    </div>
                  </div>
                </CardContent>
              </Card>

              {/* Wallet Information - Enhanced */}
              {selectedUser.wallet && (
                <Card className="border-2 border-slate-100 shadow-lg hover:shadow-xl transition-shadow duration-300">
                  <CardHeader className="bg-gradient-to-r from-green-50 via-emerald-50 to-teal-50 pb-5 border-b-2 border-slate-100">
                    <CardTitle className="flex items-center gap-2 text-lg font-bold text-slate-800">
                      <Wallet className="w-6 h-6 text-green-600" />
                      Wallet Information
                    </CardTitle>
                  </CardHeader>
                  <CardContent className="pt-6 bg-white">
                    <div className="grid grid-cols-1 md:grid-cols-3 gap-5">
                      <div className="text-center p-6 bg-gradient-to-br from-green-50 to-emerald-50 rounded-2xl border-2 border-green-200 shadow-md hover:shadow-xl transition-all hover:scale-105">
                        <div className="w-16 h-16 bg-gradient-to-br from-green-400 to-emerald-600 rounded-2xl flex items-center justify-center text-white mx-auto mb-4 shadow-lg">
                          <DollarSign className="w-8 h-8" />
                        </div>
                        <Label className="text-green-700 text-xs font-bold block mb-2 uppercase tracking-wide">Available Balance</Label>
                        <p className="text-3xl font-extrabold text-green-600 drop-shadow-sm">
                          ${selectedUser.wallet.balance?.toFixed(2)}
                        </p>
                      </div>
                      <div className="text-center p-6 bg-gradient-to-br from-orange-50 to-amber-50 rounded-2xl border-2 border-orange-200 shadow-md hover:shadow-xl transition-all hover:scale-105">
                        <div className="w-16 h-16 bg-gradient-to-br from-orange-400 to-amber-600 rounded-2xl flex items-center justify-center text-white mx-auto mb-4 shadow-lg">
                          <Lock className="w-8 h-8" />
                        </div>
                        <Label className="text-orange-700 text-xs font-bold block mb-2 uppercase tracking-wide">Locked Balance</Label>
                        <p className="text-3xl font-extrabold text-orange-600 drop-shadow-sm">
                          ${selectedUser.wallet.locked_balance?.toFixed(2)}
                        </p>
                      </div>
                      <div className="text-center p-6 bg-gradient-to-br from-blue-50 to-cyan-50 rounded-2xl border-2 border-blue-200 shadow-md hover:shadow-xl transition-all hover:scale-105">
                        <div className="w-16 h-16 bg-gradient-to-br from-blue-400 to-cyan-600 rounded-2xl flex items-center justify-center text-white mx-auto mb-4 shadow-lg">
                          <TrendingUp className="w-8 h-8" />
                        </div>
                        <Label className="text-blue-700 text-xs font-bold block mb-2 uppercase tracking-wide">Total Balance</Label>
                        <p className="text-3xl font-extrabold text-blue-600 drop-shadow-sm">
                          ${((selectedUser.wallet.balance || 0) + (selectedUser.wallet.locked_balance || 0)).toFixed(2)}
                        </p>
                      </div>
                    </div>
                  </CardContent>
                </Card>
              )}

              {/* Activity Stats - Enhanced */}
              <Card className="border-2 border-slate-100 shadow-lg hover:shadow-xl transition-shadow duration-300">
                <CardHeader className="bg-gradient-to-r from-purple-50 via-pink-50 to-rose-50 pb-5 border-b-2 border-slate-100">
                  <CardTitle className="flex items-center gap-2 text-lg font-bold text-slate-800">
                    <Activity className="w-6 h-6 text-purple-600" />
                    Activity Overview
                  </CardTitle>
                </CardHeader>
                <CardContent className="pt-6 bg-white">
                  <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
                    <div className="text-center p-5 bg-gradient-to-br from-purple-50 to-violet-50 rounded-2xl border-2 border-purple-200 shadow-md hover:shadow-xl transition-all hover:scale-105">
                      <BarChart3 className="w-12 h-12 text-purple-500 mx-auto mb-3 drop-shadow-sm" />
                      <Label className="text-purple-700 text-xs font-bold block mb-2 uppercase tracking-wide">Transactions</Label>
                      <p className="text-2xl font-extrabold text-purple-600">
                        {selectedUser.transaction_count || 0}
                      </p>
                    </div>
                    <div className="text-center p-5 bg-gradient-to-br from-blue-50 to-cyan-50 rounded-2xl border-2 border-blue-200 shadow-md hover:shadow-xl transition-all hover:scale-105">
                      <PieChart className="w-12 h-12 text-blue-500 mx-auto mb-3 drop-shadow-sm" />
                      <Label className="text-blue-700 text-xs font-bold block mb-2 uppercase tracking-wide">Stakings</Label>
                      <p className="text-2xl font-extrabold text-blue-600">
                        {selectedUser.staking_positions?.length || 0}
                      </p>
                    </div>
                    <div className="text-center p-5 bg-gradient-to-br from-green-50 to-emerald-50 rounded-2xl border-2 border-green-200 shadow-md hover:shadow-xl transition-all hover:scale-105">
                      <TrendingUp className="w-12 h-12 text-green-500 mx-auto mb-3 drop-shadow-sm" />
                      <Label className="text-green-700 text-xs font-bold block mb-2 uppercase tracking-wide">Investments</Label>
                      <p className="text-2xl font-extrabold text-green-600">
                        {selectedUser.investment_positions?.length || 0}
                      </p>
                    </div>
                    <div className="text-center p-5 bg-gradient-to-br from-amber-50 to-yellow-50 rounded-2xl border-2 border-amber-200 shadow-md hover:shadow-xl transition-all hover:scale-105">
                      <Star className="w-12 h-12 text-amber-500 mx-auto mb-3 drop-shadow-sm" />
                      <Label className="text-amber-700 text-xs font-bold block mb-2 uppercase tracking-wide">Success Rate</Label>
                      <p className="text-2xl font-extrabold text-amber-600">
                        {selectedUser.success_rate || '0%'}
                      </p>
                    </div>
                  </div>
                </CardContent>
              </Card>
            </div>
          )}

          <DialogFooter className="border-t border-slate-200 pt-4 bg-gradient-to-r from-slate-50 to-white -mx-6 -mb-6 px-6 pb-6 rounded-b-lg">
            <Button 
              variant="outline" 
              onClick={() => setShowDetailDialog(false)} 
              className="flex items-center gap-2 hover:bg-slate-100 transition-colors shadow-sm"
            >
              <XCircle className="w-4 h-4" />
              Close
            </Button>
          </DialogFooter>
        </DialogContent>
      </Dialog>

      {/* Send Notification Dialog */}
      <SendNotificationDialog
        isOpen={showNotificationDialog}
        onClose={() => {
          setShowNotificationDialog(false);
          setNotificationUserId(null);
          setNotificationUserEmail('');
        }}
        userId={notificationUserId}
        userEmail={notificationUserEmail}
      />
    </div>
  );
};

